import React, { useState } from 'react';
import DiffView from './DiffView'; // Assuming DiffView component in same directory
import 'react-diff-view/style/index.css';

function App() {
  const [codeA, setCodeA] = useState('const message = "Hello World";');
  const [codeB, setCodeB] = useState('const message = "Hello React!";');

  return (
    <div className="App">
      <h1>Code Diff</h1>
      <textarea
        value={codeA}
        onChange={(e) => setCodeA(e.target.value)}
        rows={10}
      />
      <textarea
        value={codeB}
        onChange={(e) => setCodeB(e.target.value)}
        rows={10}
      />
      <DiffView codeA={codeA} codeB={codeB} />
    </div>
  );
}

export default App;
